import logo from "./logo.svg";
import "./App.css";
import {
  Button,
  Icon,
  Menu,
  Header,
  Image,
  Sidebar,
  Segment
} from "semantic-ui-react";
import React, { Component } from "react";
import ProfilePic from "./raghu.jpg";

class App extends Component {
  handleItemClick = (e, { name }) => this.setState({ activeItem: name });
  render() {
    return (
      <div className="background-image App App-header">
        <Sidebar.Pushable as={Segment}>
          <VerticalSidebar animation="push" direction="left" visible="true" />

          <Sidebar.Pusher dimmed="false">
            <Segment basic>
              <Header as="h3">Application Content</Header>
              <Image src={ProfilePic} />
            </Segment>
          </Sidebar.Pusher>
        </Sidebar.Pushable>
        <Image centered src={ProfilePic} size="medium" circular bordered />
        <Header icon as="h1" style={{ color: "white" }}>
          <Header.Content>Shri Raghu Raaman</Header.Content>
        </Header>
      </div>
    );
  }
}

export default App;
